widgets.value:
JS{{

var a = @{actglobal@{parent.variables.n}.value}
var b = @{trigglobal@{parent.variables.n}.value}
var c = @{chaostrigglobal@{parent.variables.n}.value}
var d = @{reverseglobal@{parent.variables.n}.value}

var e = a + b + c + d
var output = "false"

if (e == 0) {
output = "false"
} else {
output = "true"
}

return [output]
}}
